import React, { useState } from 'react';

const MOCK_TECHNIQUES = [
  {
    _id: '1',
    name: 'Pêche au coup',
    description: 'La pêche au coup est une technique de pêche très populaire, particulièrement adaptée aux débutants.',
    difficulty: 'Facile',
    imageUrl: 'https://images.unsplash.com/photo-1516962126636-27ad087061cc?w=800',
    equipment: ['Canne au coup', 'Ligne', 'Flotteur', 'Hameçons', 'Amorce']
  },
  {
    _id: '2',
    name: 'Pêche aux leurres',
    description: 'La pêche aux leurres est une technique active qui consiste à attraper les poissons carnassiers.',
    difficulty: 'Intermédiaire',
    imageUrl: 'https://images.unsplash.com/photo-1595183405644-6b3b0f6538bd?w=800',
    equipment: ['Canne spinning', 'Moulinet', 'Leurres', 'Bas de ligne']
  },
  {
    _id: '3',
    name: 'Pêche à la mouche',
    description: 'La pêche à la mouche est une technique élégante qui imite les insectes dont se nourrissent les poissons.',
    difficulty: 'Difficile',
    imageUrl: 'https://images.unsplash.com/photo-1499242611767-cf8b9be02854?w=800',
    equipment: ['Canne à mouche', 'Soie', 'Mouches artificielles', 'Waders']
  }
];

const TechniqueCard = ({ technique }) => (
  <div className="bg-white rounded-lg shadow-lg overflow-hidden transform hover:scale-105 transition duration-200">
    <img src={technique.imageUrl} alt={technique.name} className="w-full h-48 object-cover" />
    <div className="p-4">
      <div className="flex justify-between items-start mb-2">
        <h3 className="text-xl font-bold text-nature-blue">{technique.name}</h3>
        <span className={`inline-block px-2 py-1 rounded text-sm ${
          technique.difficulty === 'Facile' ? 'bg-green-100 text-green-800' :
          technique.difficulty === 'Intermédiaire' ? 'bg-yellow-100 text-yellow-800' :
          'bg-red-100 text-red-800'
        }`}>
          {technique.difficulty}
        </span>
      </div>
      <p className="text-gray-600 mb-4">{technique.description}</p>
      <div className="space-y-2">
        <h4 className="font-semibold text-gray-700">Équipement nécessaire:</h4>
        <div className="flex flex-wrap gap-2">
          {technique.equipment.map((item, index) => (
            <span key={index} className="inline-block bg-gray-100 text-gray-600 px-2 py-1 rounded text-sm">
              {item}
            </span>
          ))}
        </div>
      </div>
    </div>
  </div>
);

const Catalog = () => {
  const [searchTerm, setSearchTerm] = useState('');
  const [difficultyFilter, setDifficultyFilter] = useState('');

  const filteredTechniques = MOCK_TECHNIQUES.filter(technique => {
    const matchesDifficulty = !difficultyFilter || technique.difficulty === difficultyFilter;
    const matchesSearch = !searchTerm || 
      technique.name.toLowerCase().includes(searchTerm.toLowerCase()) ||
      technique.description.toLowerCase().includes(searchTerm.toLowerCase());
    return matchesDifficulty && matchesSearch;
  });

  return (
    <div className="max-w-6xl mx-auto px-4 py-8">
      <h1 className="text-3xl font-bold text-nature-blue mb-8">Techniques de Pêche</h1>

      <div className="mb-8 flex flex-wrap gap-4">
        <input
          type="text"
          value={searchTerm}
          onChange={(e) => setSearchTerm(e.target.value)}
          placeholder="Rechercher une technique..."
          className="flex-1 p-2 border border-gray-300 rounded focus:ring-2 focus:ring-nature-blue focus:border-transparent"
        />
        <select
          value={difficultyFilter}
          onChange={(e) => setDifficultyFilter(e.target.value)}
          className="p-2 border border-gray-300 rounded focus:ring-2 focus:ring-nature-blue focus:border-transparent"
        >
          <option value="">Toutes les difficultés</option>
          <option value="Facile">Facile</option>
          <option value="Intermédiaire">Intermédiaire</option>
          <option value="Difficile">Difficile</option>
        </select>
      </div>

      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
        {filteredTechniques.map((technique) => (
          <TechniqueCard key={technique._id} technique={technique} />
        ))}
      </div>

      {filteredTechniques.length === 0 && (
        <div className="text-center py-12">
          <p className="text-gray-600">
            Aucune technique trouvée. Essayez d'autres termes de recherche.
          </p>
        </div>
      )}
    </div>
  );
};

export default Catalog;
